import React from 'react';

const List = ({ id, description, completed, toggleCompleted }) => {
  return (
    <div className="flex items-center justify-between py-2 border-b border-gray-200">
      <div className="flex items-center">
        <input
          type="checkbox"
          id={`todo-${id}`}
          checked={completed}
          onChange={() => toggleCompleted(id)}
          className="mr-4"
        />
        <label htmlFor={`todo-${id}`} className={completed ? 'line-through' : ''}>
          {description}
        </label>
      </div>
      {/* <button className="text-red-500" onClick={() => deleteTodo(id)}>
        Delete
      </button> */}
    </div>
  );
};

export default List;
